import axios from 'axios';

const YourComponent = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('mongodb+srv://AliDehissy:07498497ali@admin.xpj4ps0.mongodb.net/users'); // Update the URL with your actual API endpoint
        setData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Your Data:</h1>
      <ul>
        {data.map((item) => (
          <li key={item._id}>{item.name} - {item.price}</li>
        ))}
      </ul>
    </div>
  );
};

export default YourComponent;
